gaes numpang tanya... ada code kayak gini:

```static string FindStringEquivalent(long numberToFind)
        {
            if (numberToFind > int.MaxValue || numberToFind < 1)
            {
                return "0";
            }


            var numbers = Enumerable.Range(1, int.MaxValue);
            var result = numbers.AsParallel().Any(number => number == numberToFind);

            return result ? numberToFind.ToString() : "0";
        }```

nah cara speed up performancenya gmn yah klo numberToFind = 2147483645?

solusi yang agak boros memory:
```static readonly HashSet<int> Numbers = new HashSet<int>(Enumerable.Range(1, int.MaxValue));

static string FindStringEquivalent(int numberToFind) {
    bool found = Numbers.Contains(numberToFind);
    return found ? numberToFind.ToString() : "0";
}```

