contoh gini:
```static void LogPerson(Person person) { // parameter tanpa ? artinya ngga boleh null
    Console.WriteLine("Person: " + person.ToString());
}

public static void Main() {
    Person? person = null;
    LogPerson(person); // di sini ada warning karena person ada kemungkinan null
    if (person != null) {
        LogPerson(person); // di sini person sudah pasti tidak null, jadi no warning
    }
    person = new Person();
    LogPerson(person); // di sini person sudah pasti tidak null, jadi no warning
}```

