immutable artinya state dari suatu object tidak bisa diubah sama sekali. kalau ada private set artinya state masih bisa diubah, biarpun hanya bisa diubah secara internal.

di dalam immutable pattern, karena kita tidak bisa ubah state sama sekali, makanya kita cuma bisa create new object kalau ada update. anggap object barunya itu adalah versi baru dari data. contoh:

```public class C {
    public int X { get; }
    public C(int x) { X = x; }
}

C obj = new C(1);

```misal kita mau ubah obj.X jadi 2, kita harus bikin instance baru:

```obj = new C(2);

```instance baru bisa juga dibuat dari instance method:

```class Person {
    public string FirstName { get; }
    public string? LastName { get; }

    public Person(string firstName, string? lastName = null) {
        FirstName = firstName;
        LastName = lastName;
    }

    public Person WithLastName(string lastName) {
        return new Person(FirstName, lastName);
    }
}

``````Person p = new Person("John");
p = p.WithLastName("Doe");```

di C# 9, kedua contoh di atas bisa disederhanakan dengan record:

```record C(int X);

C obj = new(1);
obj = new(2);```

untuk contoh Person:

```record Person(string FirstName, string? LastName = null);

Person p = new Person("John");
p = p with { LastName = "Doe" };```

