public static string EncryptString(string plainText)
  {
   var key = GetKey(keyPhrase);
   var output = new byte[12];

   using (var aes = Aes.Create())
   using (var encryptor = aes.CreateEncryptor(key, key)){
    var encryptedText = Encoding.UTF8.GetBytes(plainText);
    Console.WriteLine($"Encrypted Text: {string.Join(",",encryptedText)}");
    var result = encryptor.TransformFinalBlock(encryptedText, 0, encryptedText.Length);
    Console.WriteLine($"Result encryptor {string.Join(",",result)}");
    return Convert.ToBase64String(result);
   }
  }

