misal ada fungsi yang mau menjumlahkan semua integer di class ini:
```class Foo {
  int X;
  int Y;
  int Z;
}```

kalau kita write code by hand, caranya gini:
```int TotalInts(Foo foo) => foo.X + foo.Y + foo.Z;```

tapi kalau kita mau write code by reflection, codenya jadi inefficient kaya gini:

```int TotalInts<T>(T obj) => typeof(T)
  .GetFields()
  .Where(field => field.FieldType == typeof(int))
  .Sum(field => (int)field.GetValue(obj));```

