saya ada 2 tebakan soal delay 500ms
1. kalau ngga mau terlalu cepat, maka Task.Delay(500) sebaiknya ditambahkan ke tasks, biar jadi minimum completion time
2. kalau tujuannya untuk timeout, maka sebaiknya pake:
```using var cts = new CancellationTokenSource();
cts.CancelAfter(500);
var timeoutToken = cts.Token;

// lalu pakai di WhenAll:
