sebenernya lambda improvement itu problem awalnya untuk kebutuhan switch expression arm yang butuh statement. contoh usage:

```var x = foo switch {
    0 => "a",
    1 => "b",
    _ => // pengennya pake { } block di sini
}```

lalu ada yang propose bikin expression block mirip kotlin:

```var x = {
    int a = 1;
    int b = 2;
    a + b // tanpa ';'
};```

akhirnya lambda diimprove agar bisa dideclare tanpa perlu sebutkan Action atau Func nya. jadi kita bisa:

```var x = (() => {
    int a = 1;
    int b = 2;
    return a + b;
})();

var x = foo switch {
    0 => "a",
    1 => "b",
    _ => (() => {
        // do something
        return "c";
    })()
};```

kurang paham rust kaya apa. tapi di kotlin stylenya kaya gitu. baris terakhir block resolve nilai dari block expression:

```val s = if (condition) "true" else "false"

val i = try { s.toInt() } catch (throwable: Throwable) { 0 }

val s = when(day) {
  0 -> "Sunday"
  1 -> {
    "Monday"
  }
}```

