@dvpr993 mudah2an ada alasan kuat kenapa harus pakai Lazy loading pattern. Kalau loading images, data, yg besar diawal mungkin lazy loading pattern bisa dipakai sebab gak mau load dulu. Tapi kebanyakan framework sudah support utk supaya bisa asynchronous dan gak berat overhead. Itu alasan utamanya kalau saya. Ini contoh bagus:

`
public class LazyLoader<T> : Lazy<T>
{
    public LazyLoader(IServiceProvider sp) : base(sp.GetRequiredService<T>) {  }
}

class Program
{
    static void Main(string[] args)
    {
        var services = new ServiceCollection();
        services.AddScoped<ITestService, TestService>();
        services.AddTransient(typeof(Lazy<>), typeof(LazyLoader<>));

        var serviceProvider = services.BuildServiceProvider();

        using (var scope = serviceProvider.CreateScope())
        {
            var service = scope.ServiceProvider.GetService<Lazy<ITestService>>();
                         Console.WriteLine(service.IsValueCreated); // false

            Console.WriteLine(service.Value == scope.ServiceProvider.GetService<ITestService>()); // true, baru di pakai
        }
    }
}`

