public async Task<IActionResult> CreateItems(List<IFormFile> files, GatepassDetailsForm detailsForm)
{
    if (!Directory.Exists("/Storage/Trans_gate_pass_detail_dokumen"))
        Directory.CreateDirectory("/Storage/Trans_gate_pass_detail_dokumen");

    detailsForm.FilesDokumen = new List<IFormFile>();
    foreach (var file in files)
    {
        if (file.Length > 0)
        {
            detailsForm.FilesDokumen.Add(file);

            var fileName = Path.GetFileNameWithoutExtension(file.FileName).Trim();
            var fileExtension = Path.GetExtension(file.FileName).Trim(); ;

            fileName = $"{DateTime.Now:yyyyMMdd}-{fileName}{fileExtension}";
            var uploadPath = Path.Combine("/Storage/Trans_gate_pass_detail_dokumen/", fileName);

            using (var stream = System.IO.File.Create(uploadPath))
            {
                await file.CopyToAsync(stream);
            }

            Debug.WriteLine($"file {file.FileName} uploaded successfully.");
        }

    }

    return View(detailsForm);
}```

