```public async Task<JsonResult> SaveObj(string obj, string username)
{
  var deliveryInvoices = JsonSerializer.Deserialize<List<InvoiceViewModel>>(obj);

  var informations = new List<object>();

  int i = 0;

  foreach (var deliveryInvoice in deliveryInvoices)
  {
    var dataTransaction = @con.Tr_Customer_Transaction
        .FirstOrDefault(a => a.TransactionID.Equals(deliveryInvoice.TransactioNo) && string.IsNullOrEmpty(a.InvoiceNo));

    i++;

    if (string.IsNullOrEmpty(dataTransaction.InvoiceNo))
    {
      string invoiceNumber = await GetInvoiceNumber(deliveryInvoice, username);

      if (invoiceNumber == "X")
      {
        informations.Add(new
        {
          Invoice = invoiceNumber,
          TransactionNo = deliveryInvoice.TransactioNo,
          Status = false,
          msg = "Invoice Not Available",
        });
      }
      else
      {
        dataTransaction.InvoiceNo = invoiceNumber;

        try
        {
          await @con.SaveChangesAsync();

          informations.Add(new
          {
            Invoice = invoiceNumber,
            TransactionNo = deliveryInvoice.TransactioNo,
            Status = true,
            msg = "",
          });
        }
        catch (Exception er)
        {
          informations.Add(new
          {
            Invoice = dataTransaction.InvoiceNo,
            TransactionNo = dataTransaction.TransactionID,
            Status = false,
            msg = er.Message,
          });
        }
      }
    }
    else
    {
      informations.Add(new
      {
        Invoice = dataTransaction.InvoiceNo,
        TransactionNo = deliveryInvoice.TransactioNo,
        Status = false,
        msg = "Invoice Already Exists",
      });
    }

  }

  return new JsonResult
  {
    Data = informations.ToList(),
  };
}```

