#TipsDotnet Tips2 yang terbaru di .NET 6:
    `MaxBy(...)`, `MinBy(...)`, `DistinctBy(...)`, `UnionBy(...)`, `IntersectBy(...)`, `ExceptBy(...)

````string merah = "Merah", biru = "Biru", kuning = "Kuning", hitam = "Hitam", putih = "Putih";

var basket1 = new[] { (Warna: merah, Harga: 7), (Warna: biru, Harga: 10), (Warna: kuning, Harga: 7) };
var basket2 = new[] { (Warna: putih, Harga: 7), (Warna: hitam, Harga: 12) };

Console.WriteLine(basket1.MaxBy(p => p.Harga).Warna == biru);
Console.WriteLine(basket1.MinBy(p => p.Harga).Warna == merah);

// item dari basket1 DistinctBy Harga (distinct)
Console.WriteLine(basket1.DistinctBy(p => p.Harga)
   .Select(p => p.Warna).SequenceEqual(new[] { merah, biru }));

// item Union dari (basket1 dan basket2) DistinctBy Harga (gabung)
Console.WriteLine(basket1.UnionBy(basket2, p => p.Harga)
   .Select(p => p.Warna).SequenceEqual(new[] { merah, biru, hitam }));

// item Unique dari basket1 dimana Harga ada di basket2 (intersect)
Console.WriteLine(basket1.IntersectBy(basket2.Select(p => p.Harga), p => p.Harga)
   .Select(p => p.Warna).SequenceEqual(new[] { merah }));

// item Unique dari basket1 dimana Harga tidak ada di basket2 (kecuali)
Console.WriteLine(basket1.ExceptBy(basket2.Select(p => p.Harga), p => p.Harga)
   .Select(p => p.Warna).SequenceEqual(new[] { biru }));```

