    _a = a;
  }
}

public class C
{
  readonly A _a;

  public C(A a)
  {
    Console.WriteLine("C");
    _a = a;
  }
}```

Jadi kita bisa pakai A di B atau C tanpa perlu pikirkan A lagi.

