@habiesmart dengan IoC contoh code nya seperti ini,

```using Microsoft.Extensions.DependencyInjection;

void Main()
{
  var services = new ServiceCollection();
  services.AddSingleton<IA, A>();
  services.AddSingleton<B>();
  services.AddSingleton<C>();

  var serviceProvider = services.BuildServiceProvider();

  serviceProvider.GetService<B>().EksekusiA();
  serviceProvider.GetService<C>().EksekusiA();
}

public interface IA
{
  void Hello();
}

public class A : IA
{
  public void Hello() => Console.WriteLine("Hello DI/IoC");
}

public class B
{
  readonly IA _a; // pakai interface

  public B(IA a)  // pakai interface
  {
    Console.WriteLine("B");
    _a = a;
  }

  public void EksekusiA() => _a.Hello();
}

public class C
{
  readonly IA _a; // pakai interface

  public C(IA a)  // pakai interface
  {
    Console.WriteLine("C");
    _a = a;
  }

  public void EksekusiA() => _a.Hello();
}```

Hasilnya sama. Perhatikan `IA` itu interface dan dipakai di class B dan class C constructor.

Bukannya mendingan pakai global exception middleware.

```public class ExceptionMiddleware
{
    private readonly RequestDelegate _next;
    private readonly ILoggerManager _logger;

    public ExceptionMiddleware(RequestDelegate next, ILoggerManager logger)
    {
        _logger = logger;
        _next = next;
    }

    public async Task InvokeAsync(HttpContext httpContext)
    {
        try
        {
            await _next(httpContext);
        }
        catch (Exception ex)
        {
            _logger.LogError($"Something went wrong: {ex}");
            await HandleExceptionAsync(httpContext, ex);
        }
    }

    private async Task HandleExceptionAsync(HttpContext context, Exception exception)
    {
        context.Response.ContentType = "application/json";
        context.Response.StatusCode = (int)HttpStatusCode.InternalServerError;

        await context.Response.WriteAsync(new ErrorDetails()
        {
            StatusCode = context.Response.StatusCode,
            Message = "Internal Server Error from the custom middleware."
        }.ToString());
    }
}

public static void ConfigureException(this IApplicationBuilder app)
{
    app.UseMiddleware<ExceptionMiddleware>();
}

```Tinggal di pakai saja,

```app.ConfigureException();

```Ini bisa tangkep semua error bukan hanya server error, tapi application error juga. Bedanya dimana dengan si Codeopinion. Sekilas gue lihat tadi dia cuma buat wrapper doang kayaknya.

